  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:03.488275\",\n\t\"name\": \"fort-niobrara-national-wildlife-refuge-narrative-report-sept-dec-1957\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Niobrara
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1957. The report begins by summarizing the weather conditions and water
  conditions during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, and raptors- is also covered.
  The Refuge development and maintenance section discusses physical developments,
  plantings, collections and receipts, and fires. Resource management is outlined;
  topics include grazing and haying.  The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, and hunting. Photographs
  and N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
